import React, { Component } from 'react';
import { GoogleMap,Map, GoogleApiWrapper } from 'react-google-maps';

const mapStyles = {
  width: '100%',
  height: '100%'
};

export class MapContainer extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={14}
        style={mapStyles}
        initialCenter={{
         lat: -1.2884,
         lng: 36.8233
        }}
      />
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyBCeAgR3VSJLN36d8Ip2OGE2X64_K-7l2E'
})(MapContainer);
